elementNodes.inherentCSS:
.noselect {
  -webkit-user-select: none;
  -moz-user-select: none;
  -ms-user-select: none;
  user-select: none;
  -webkit-touch-callout: none;
  -khtml-user-select: none;
}
.InputBoxWithSelector {
  line-height: 1;
  position: relative;
  box-sizing: border-box;
  width: 100%;
}
.InputBoxWithSelector.red .input-wrapper input {
  border: solid 1px #d9534f;
}
.InputBoxWithSelector.red .input-wrapper input + .spread-out {
  color: #c12e2a;
}
.InputBoxWithSelector.red .input-wrapper .selector-wrapper ul.selector {
  box-shadow: 0 5px 5px rgba(0, 0, 0, 0.4);
}
.InputBoxWithSelector.red .input-wrapper .selector-wrapper ul.selector li {
  color: #fff;
  background-color: #d9534f;
}
.InputBoxWithSelector.red .input-wrapper .selector-wrapper ul.selector li:hover {
  background-color: #c12e2a;
}
.InputBoxWithSelector.red .input-wrapper .selector-wrapper ul.selector li.cursor-here {
  color: #333;
  border: solid 1px #d9534f;
  background-color: #fff;
}
.InputBoxWithSelector.white-gray .input-wrapper input {
  border: solid 1px #545454;
  border-radius: 3px;
}
.InputBoxWithSelector.white-gray .input-wrapper input + .spread-out {
  color: #2a2a2a;
}
.InputBoxWithSelector.white-gray .input-wrapper .selector-wrapper ul.selector {
  box-shadow: 0 5px 5px rgba(0, 0, 0, 0.4);
}
.InputBoxWithSelector.white-gray .input-wrapper .selector-wrapper ul.selector li {
  color: #fff;
  background-color: #545454;
}
.InputBoxWithSelector.white-gray .input-wrapper .selector-wrapper ul.selector li:hover {
  background-color: #333;
}
.InputBoxWithSelector.white-gray .input-wrapper .selector-wrapper ul.selector li.cursor-here {
  color: #333;
  border: solid 1px #545454;
  background-color: #fff;
}
.InputBoxWithSelector.gray .input-wrapper input {
  color: #eee;
  border: solid 1px #545454;
  border-radius: 3px;
  background-color: #565656;
}
.InputBoxWithSelector.gray .input-wrapper input + .spread-out {
  color: #222;
}
.InputBoxWithSelector.gray .input-wrapper .selector-wrapper ul.selector {
  box-shadow: 0 5px 5px rgba(0, 0, 0, 0.9);
}
.InputBoxWithSelector.gray .input-wrapper .selector-wrapper ul.selector li {
  color: #fff;
  background-color: #333;
}
.InputBoxWithSelector.gray .input-wrapper .selector-wrapper ul.selector li:hover {
  background-color: #222;
}
.InputBoxWithSelector.gray .input-wrapper .selector-wrapper ul.selector li.cursor-here {
  color: #eee;
  border: solid 1px #545454;
  background-color: #454545;
}
.InputBoxWithSelector .input-wrapper {
  position: relative;
  box-sizing: border-box;
  width: 100%;
}
.InputBoxWithSelector .input-wrapper input {
  font-size: 14px;
  box-sizing: border-box;
  width: 100%;
  height: 24px;
  padding: 3px 10px;
  outline: none;
}
.InputBoxWithSelector .input-wrapper input + .spread-out {
  font-size: 14px;
  position: absolute;
  top: 0;
  right: 0;
  box-sizing: border-box;
  height: 24px;
  padding: 3px 10px;
  cursor: pointer;
}
.InputBoxWithSelector .input-wrapper input.clickable {
  cursor: pointer;
}
.InputBoxWithSelector .input-wrapper .selector-wrapper {
  position: relative;
  width: 100%;
}
.InputBoxWithSelector .input-wrapper .selector-wrapper ul.selector {
  position: absolute;
  z-index: 1000;
  width: 100%;
  margin: 0;
  padding: 0;
}
.InputBoxWithSelector .input-wrapper .selector-wrapper ul.selector li {
  font-size: 12px;
  box-sizing: border-box;
  margin: 0;
  padding: 5px 10px;
  cursor: pointer;
}
.InputBoxWithSelector .input-wrapper[data-dontEnter=true] {
  cursor: pointer;
}

